            'VNOOM280_RET' => 'Vnoom280_RET-x7X',
            'VNOOM345' => 'Vnoom345-Noh',
            'VPARLEZ-DE-VOUS24' => 'Vparlez-de-vous24',
            'VSALONDECOR65' => 'Vsalondecor65',
            'VSHTAIM38' => 'Vshtaim38',
            'VTRASH-TLV933' => 'Vtrash-tlv933-mpc',
            'VYAELADMONI389389' => 'Vyael-admoni389_REP',
        ];
        $missingBarcodeOrders = [];
        foreach ($missingBarcodes as $barcode => $orderName) {
            $order = Order::where('name', $orderName)->first();

            $missingBarcodeOrders[] = [
                'barcode' => $barcode,
                'order' => $order,
            ];
        }

        $res = [
            'Missing Delivery' => [],
            'Mismatched Delivery' => [],
            'Missing Bill' => [],
            'Missing Order' => [],
            'Unpaid Order' => [],
            'Total Untaxed' => 0,
        ];

        $billingRepo = new BillingRepository();

        foreach (array_merge($unpaidBillsData, $unBilledDeliveries, $missingBarcodeOrders) as $unpaidBillData) {
            if ($unpaidBillData['order'] instanceof Order) {
                $order = $unpaidBillData['order'];
                $delivery = $order->delivery;
                if (!$delivery) {
                    $res['Missing Delivery'][] = $unpaidBillData;
                }
            } else {
                $order = Order::find($unpaidBillData['order']['id']);
                $delivery = Delivery::where('barcode', $unpaidBillData['barcode'])->first();
            }

            if (!$order) {
                $res['Missing Order'][] = $unpaidBillData;
                continue;
            }

            switch ($order->store_slug) {
                case 'fiocco':
                case 'catopia-israel':
                case 'kika':
                    break;
                default:
                    if (
                        !$order->delivery ||
                        !$delivery->order ||
                        $order->id !== $delivery->order_id
                    ) {
                        if (is_null($delivery->order)) {
                            $delivery->update(['order_id' => $order->id]);
                            $order->load('delivery');
                        }

                        if ($order->id !== $delivery->order_id) {
                            $res['Mismatched Delivery'][] = array_merge($unpaidBillData, [
                                'Order ID' => $order->id,
                                'Delivery Order ID' => $delivery->order_id,
                                'Delivery Order' => $delivery->order,
                            ]);
                            continue 2;
                        }
                    }

                    if (!$order->delivery->bill) {
                        $bill = $billingRepo->billDelivery($order->delivery);
                        if (isset($bill['fail'])) {
                            $res['Missing Bill'][] = array_merge($unpaidBillData, $bill);
                            continue 2;
                        }
                        $order->delivery->load('bill');
                    }

                    if (!$order->delivery->bill->transaction_id) {
                        $res['Unpaid Order'][] = $unpaidBillData;
                        $res['Total Untaxed'] += $order->delivery->bill->total;
                        continue 2;
                    }
            }
        }
        $res['Total Taxed'] = $res['Total Untaxed'] * 1.17;
        $res['Total Taxed'] = number_format($res['Total Taxed'], 2);
        $res['Total Untaxed'] = number_format($res['Total Untaxed'], 2);

        Log::info('res', $res);
